import { data } from '../../data/logement'
import Card from '../Card'
import '../Gallery/index.css'

function Gallery () {
return (

  <section className="gallery">
    {data.map((data) => {
      return ( 
        <Card key={data.id} id={data.id} cover={data.cover} title={data.title} />
    )})}
</section> 
)

}

export default Gallery
